import React from 'react';
import { photos } from '../../photoData'; // Adjust the path as necessary

function Courses() {
    return (
        <div>
            <h1>Our Courses</h1>
            {photos.map((photo) => (
                <img
                    key={photo.id}
                    src={photo.url}
                    alt={`Photo ${photo.id}`}
                    style={{ width: '100px', margin: '10px' }}
                />
            ))}
        </div>
    );
}

export default Courses;
